import React from 'react'
import { Routes, Route } from "react-router-dom";
import './style/App.css';
import Mainmenupage from "./components/Mainmenupage.jsx";
import Fancontentpage from "./components/Fancontentpage.js";
import Pagevideogames from "./components/Pagevideogames.jsx";
import Pagecharacters from "./components/Pagecharacters";

const  App= ()  => {
  return (
  <div className="App">
    <Routes>
      <Route path="/" element={<Mainmenupage />} />
      <Route path="/characters" element={<Pagecharacters />} />
      <Route path="/fancontent" element={<Fancontentpage />} />
      <Route path="/videogames" element={<Pagevideogames />} />
    </Routes>
  </div>
  );
}
export default App;
